/*
Detailed modification summary (modularization)
- Created BlinkController module to encapsulate LED blinking logic with non-blocking timing using millis().
- Centralized hardware constants in Config.h (e.g., LED_PIN, BLINK_INTERVAL_MS) for easier hardware reconfiguration.
- Main sketch (codice.ino) updated to include BlinkController.h and to call BlinkController_begin() in setup and BlinkController_update() in loop.
- Preserved existing behavior of LED blinking according to system requirements, implemented via a modular controller to allow future extensions without blocking main loop.
- The new module pattern enables straightforward addition of future controllers (e.g., SensorController, DisplayController) following the non-blocking pattern.
- All changes are compatible with Arduino Uno (no dynamic memory allocation, simple static state).
- Existing "/****** SYSTEM REQUIREMENTS *****/" comments in code are preserved if present; new changes are documented here only and not repeated in the user-facing system specification comments.
*/

#include "Config.h" 
#include "BlinkController.h" 

void setup() {
  // Initialize blink controller
  BlinkController_begin();
}

void loop() {
  // Update blink state (non-blocking)
  BlinkController_update();
}

/* END CODE */
